import React from "react";
import "./About.css";
import Navbar from "./Navbar";
import heroImage from "/Users/aniruddhkapileshwari/Desktop/Deepa-pot/deepa-portfolio/src/assets/1.png"; // Importing the image

const About = () => {
  return (
    <div className="about-hero-container">
      <Navbar />
      <div className="about-hero-content">
        <div className="about-hero-text">
          <h2 className="about-hero-subtitle">
            About<br />
            <span className="about-hero-name">Deepa Devangmath</span><br />
            Architecture | Urban Design | Interior
          </h2>
        </div>
        <div className="about-hero-illustration">
          <img 
            src={heroImage} 
            alt="Hero Illustration" 
            className="about-hero-image"
          />
        </div>
      </div>
    </div>
  );
};

export default About;
